import React, { useState } from "react";

const HoverCounter = () => {
  const [count, setCount] = useState(0);
  return (
    <div>
      <h2>Count is:{count}</h2>
      <button
        onMouseOver={() => {
          setCount(count + 1);
        }}
      >
        Hover me
      </button>
    </div>
  );
};

export default HoverCounter;
